import React from 'react'
import './affichePhoto.css'
import { useEffect } from 'react'

export default function AffichePhoto(props) {

    useEffect(() => {
        props.allImg.forEach(element => {
            console.log(element.image)
        });
    }, [])

  return (
    <div className='containerAffichePhoto'>
        <p>
            <img src={`http://localhost:5000`+props.allImg.image} alt="" />
        </p>
        <p>
            { props.allImg.map((element)=>{
                return(
                    <img key={element._id}  src={`http://localhost:5000`+element.image} alt="" />
                )
            })}
        </p>
    </div>
  )
}
